import axios from 'axios'

const BASE_URL = "www.themealdb.com/api/json/v1/1/"

class Products {
    static getRandomProduct = async ()=> {
        const res = await axios.get(`${BASE_URL}/random.php`)
        return res
    }
}

export default Products
